🎼✨PRODIGES :BEHIND THE SCENES! 👀🎥
Pour cause de finale de la coupe du monde de rugby (les studios sont à côté du stade de France), le tournage de cette demi-finale a dû être décalé beaucoup plus tôt ! Résultat, un réveil à 4h45 pour tous les jeunes talents, qui étaient donc présents sur le plateau, au taquet, dès 6h30. 🎶🩰🎵
Alors vous qui serez devant votre écran à découvrir ce merveilleux spectacle, vous pourrez les applaudir encore plus fort ! 
Franchement chapeau, bravo à tous !
